        #region 类的方法
        #region 索引器[Public]
        /// <summary>
        /// 索引器
        /// </summary>
        /// <param name="key">NML编码</param>
        /// <param name="module">NML所属模块名</param>
        /// <returns>NML内容</returns>
        public string this[string key, string module]
        {
            get
            {
                try
                {
                    string _Enc = "";
                    if ( module == "﻿ otms" )
                    {
                        _Enc = ﻿ otms[ key ].ToString();
                    }

                    if ( _Enc.Length == 0 )
                    {
                        return "";
                    }
                    else
                    {
                        return Base64Decrypt(_Enc);
                    }
                }
                catch
                {
                    return "";
                }
            }
            set
            {
                 string _Dec = value;
                 if ( module == "﻿ otms" )
                 {
                    this.﻿ otms[ key ] = Base64Encrypt( _Dec );
                 }
            }
        }
        #endregion

