        #region 类的私有函数
        #region Base64Encrypt Base64编码
        /// <summary>Base64编码</summary>
        /// <param name="sSrc">需要编码的字符串</param>
        /// <returns>编码完成后的字符串</returns>
        private string Base64Encrypt( string sSrc )
        {
            try
            {
                byte[] bCode = Encoding.UTF8.GetBytes( sSrc );

                return Convert.ToBase64String( bCode );
            }
            catch
            {
                return "";
            }
        }
        #endregion

        #region Base64Decrypt Base64解码
        /// <summary>Base64解码</summary>
        /// <param name="sEnc">需要解码的字符串</param>
        /// <returns>编码完成后的字符串</returns>
        private string Base64Decrypt( string sEnc )
        {
            try
            {
                byte[] bCode = Convert.FromBase64String( sEnc );

                return Encoding.UTF8.GetString( bCode );
            }
            catch
            {
                return "";
            }
        }
        #endregion
        #endregion
